import {useNavigate} from 'react-router-dom';

export const Page3 = () => {
    const naviGate = useNavigate();
    let clickCount = 0;
    const redirectPage1 = () => {
        clickCount += 1;
        console.log(clickCount);
        if (clickCount < 13) {
            window.alert('撤退は許されない...');
        } else if (clickCount === 13) {
            window.alert('今日のところはこの辺にしといてやる');
            clickCount = 0;
            naviGate('/');
        } else if (clickCount > 13) {
            clickCount = 0;
        }
    };
    return (
        <>
            <div>
                <h1>隼人のお仕置き部屋</h1>
                <button onClick={redirectPage1}>最初に戻る</button>
            </div>
        </>
    );
};
